window.bookSummaryJSON = "<p><b>In the ninth installment in Kevin Hearne’s </b><b><i>New York Times </i></b><b>bestselling Iron Druid Chronicles, the ancient gods are still wreaking havoc today in this hilarious, action-packed collection of original short stories featuring Atticus O’Sullivan.</b><br> <br> In ancient Egypt, Atticus agrees to raid a secret chamber underneath the library of Alexandria, dodging deadly traps, only to learn that on-site security includes two members of the Egyptian pantheon.<br> <br> At a Kansas carnival, fun and games turn to murder and mayhem, thanks to soul-snatching demons and flesh-craving ghouls luring visitors into an all-too-real house of horrors.<br> <br> In olde England, striking up a friendship with William Shakespeare lands both Atticus and the Bard in boiling hot water with a trio of infamous witches.<br> <br> During the Gold Rush, the avatar of greed himself turns the streets of San Francisco red with blood and upsets the elemental Sequoia. Atticus may have to fight fire with fire if he’s going to restore balance.<br> <br> More, you say? Indeed there is—including bogeymen, vampire hordes, wrathful wraiths, and even a journey to the realm of the dead. Prepare to be besieged with ten tantalizing tales—not to be missed, never to be forgotten.<br> <br> <b>Don’t miss any of&nbsp;The Iron Druid Chronicles:<br> </b><b><i>Hounded | Hexed | Hammered | Tricked | Trapped | Hunted | Shattered | Staked | Scourged | Besieged</i></b></p>"; 
